import React from "react";

const ContactPane = () => {
	return (
		<div
			className="container-fluid px-0 banner w-100 d-flex justify-content-center align-items-center"
			style={{
				background: `linear-gradient(rgba(28, 58, 227, 0.7), rgba(28, 58, 227, 0.7)), url('/images/contact-bg.jpg') 40% 60%`,
				height: "700px",
			}}
		>
			<div className="container centerContainer px-0">
				<div className="row">
					<div className="col-lg-8 mx-auto bg-light">
						<div className="row w-100 h-100">
							<div className="col-lg-4 bg-primary h-100">
                                <h2 className="text-light">Contact Us</h2>
                                <p>i.fa.fa-map</p>
                            </div>
							<div className="col-lg-8">Contact us now</div>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default ContactPane;
